    public int[] answerQueries(int[] nums, int[] queries) {
        Arrays.sort(nums);
        int[] queriesClone = queries.clone();
        Arrays.sort(queriesClone);
        int[] answers = new int[queriesClone.length];
        int sum = 0;
        int i=0, j=0;
        while(i<nums.length && j<queriesClone.length) {
            sum += nums[i++];
            while(j<queriesClone.length && queriesClone[j] < sum) {
                answers[j++] = i-1;
            }
        }
        while(j<queriesClone.length) {
            answers[j++] = nums.length;
        }
        Map<Integer, Integer> map = new HashMap<>();
        for(int k=0; k<queries.length; k++) {
            map.put(queriesClone[k], answers[k]);
        }

        int[] newAnswer = new int[queries.length];
        for(int k=0; k<queries.length; k++) {
            newAnswer[k] = map.get(queries[k]);
        }
        return newAnswer;
    }



    public String removeStars(String s) {
        StringBuilder sb = new StringBuilder();
        char[] chs = s.toCharArray();

        for(int i=0; i<chs.length; i++) {
            if(chs[i] != '*') sb.append(chs[i]);
            else {
                sb.deleteCharAt(sb.length()-1);
            }
        }

        return sb.toString();
    }


    // TLE
    public String removeStars2(String s) {
        char[] chs = s.toCharArray();
        List<Character> list = new LinkedList<>();
        for(int x=0; x<chs.length; x++){
            list.add(chs[x]);
        }

        int j=0;
        while(j<list.size()) {
            if(list.get(j) == '*') {
                list.remove(j);
                list.remove(j-1);
                j--;
            } else {
                j++;
            }
        }

        String subS = "";
        for(int x=0; x<list.size(); x++) {
            subS += list.get(x);
        }
        return subS;
    }



    // TLE
    public String removeStars1(String s) {
        return removeStars(s, new HashMap<>());
    }

    private String removeStars(String s, Map<String, String> map) {
        if(map.containsKey(s)) {
            return map.get(s);
        }
        int index = s.indexOf('*');
        if(index == -1) return s;
        String subS = "";
        if(index > 1) {
            subS += s.substring(0, index-1);
        }
        if(index+1 < s.length()) {
            subS += s.substring(index+1);
        }
        String removedS = removeStars(subS, map);

        if(!map.containsKey(s)) {
            map.put(s, removedS);
        }
        return removedS;
    }
